import React, { useState } from 'react';
import styles from './ClubRegister.module.css';
const ClubRegister = () => {
  const [formData, setFormData] = useState({
    cname: '',
    caname: '',
    cpname: '',
    cmail: '',
    cid: '',
    cmobile: '',
    cpassword: ''
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const res = await fetch('http://localhost:3001/api/clubs/register', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify(formData)
      });

      const result = await res.json();
      alert(result.message);

      if (res.ok) {
        window.location.href = '/login-club'; // Navigate to club login page
      }
    } catch (err) {
      console.error('Frontend error:', err);
      alert('Registration failed (Frontend)');
    }
  };

  return (
    <div className={styles.body}> {/* Applying body styles if needed */}
      <div className={styles.container}>
        <h2>Club Registration</h2>
        <form onSubmit={handleSubmit}>
          <div className={styles.inputGroup}>
            <input
              type="text"
              id="cname"
              name="cname"
              value={formData.cname}
              onChange={handleChange}
              required
            />
            <label htmlFor="cname">Club Name</label>
          </div>

          <div className={styles.inputGroup}>
            <input
              type="text"
              id="caname"
              name="caname"
              value={formData.caname}
              onChange={handleChange}
              required
            />
            <label htmlFor="caname">Advisor Name</label>
          </div>

          <div className={styles.inputGroup}>
            <input
              type="text"
              id="cpname"
              name="cpname"
              value={formData.cpname}
              onChange={handleChange}
              required
            />
            <label htmlFor="cpname">President Name</label>
          </div>

          <div className={styles.inputGroup}>
            <input
              type="email"
              id="cmail"
              name="cmail"
              value={formData.cmail}
              onChange={handleChange}
              required
            />
            <label htmlFor="cmail">Club Email</label>
          </div>

          <div className={styles.inputGroup}>
            <input
              type="number"
              id="cid"
              name="cid"
              value={formData.cid}
              onChange={handleChange}
              required
              min="10000000"
              max="99999999"
            />
            <label htmlFor="cid">Club ID</label>
          </div>

          <div className={styles.inputGroup}>
            <input
              type="number"
              id="cmobile"
              name="cmobile"
              value={formData.cmobile}
              onChange={handleChange}
              required
            />
            <label htmlFor="cmobile">Mobile Number</label>
          </div>

          <div className={styles.inputGroup}>
            <input
              type="password"
              id="cpassword"
              name="cpassword"
              value={formData.cpassword}
              onChange={handleChange}
              required
            />
            <label htmlFor="cpassword">Choose Password</label>
          </div>

          <div className={styles.options}>
            <label>
              <input type="checkbox" /> Remember Me
            </label>
            <a href="#" className={styles.a}>Forgot Password?</a>
          </div>

          <button type="submit" className={styles.button}>
            Register Club
          </button>

          <div className={styles.register}>
            Already have an account? <a href="/login-club" className={styles.a}>Log In</a>
          </div>
        </form>
      </div>
    </div>


  );
};

export default ClubRegister;
